function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/play" element={<Play socket={socket}/>} />
        <Route path="/game" element={<Game socket={socket}/>} />
        {/* <Redirect to="/" /> */}
      </Routes>
    </Router>
  );
}

export default App;
